package Collection2;

public class Stack {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		java.util.Stack<String> lt=new java.util.Stack<String>();
	       lt.add("rajat");
	       lt.add("aloke");
	       lt.add("raja");
	       lt.push("nayan");
	       for(Object o:lt)
	       {
	    	   System.out.println(o);
	       }
	       
	} 

}
